import axios from 'axios';

 const getEnderecoPorCep = (cep) => {
    try {

       axios.get(`https://viacep.com.br/ws/${cep}/json/`);

    } catch (error) {
      console.error(error);
    }
  }


  export const teste = () =>{
      let data = {};
      return  getEnderecoPorCep('60352590').then(res =>{
          data.cep = res.data.cep;
      });
  }
